description:
Total Recall 2011
#2
Dynamite comics
cbr

Continuing the sequel to the smash hit 1990 film, Douglas Quaid and his dream lady Melina find themselves reeling after the tragic conclusion to issue #1. Yet there is no time to mourn as the Mars colony struggles to keep itself from falling apart. With more tragedy on the way, Quaid and Melina have to figure out whats going on before all hell breaks loose. Meanwhile the mystery of Mars itself deepens, and as our 
heroes discover, the creation of air for Mars was just the beginning.
